import React from "react";
import { Container} from "react-bootstrap";
import Topbar from "./Navbar";
import "./style.css";
import {  } from "react-bootstrap";



const Back = () => {
    return (
        <div className="cover">
            <div className="cover_overlay">
            <Topbar />

            <Container className="text-white" style={{zIndex: "2", marginTop:"100pt"}}>


                <h1>The Ultimate Site</h1>
                <p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem<br /> accusantium doloremque laudantium, totam rem aperiam, eaque<br /> ipsa quae ab illo inventore veritatis et quasi</p>
            </Container>
            </div>
        </div>
    )
}

export default Back;
